# Title of the document
title: "Dashboard clientes enero"

# Metadata
dataset:
  description: "Dashboard of dataset clientes enero"
  creator: "Jose Angel Carballo Sanchez"
  author: "Miguel Moreno"
  copyright_holder: ""
  copyright_year: ""

variables:
  descriptions: {
    "edad": "Edad de los clientes.",
    "facturacion": "Dinero que pagan los clientes al mes.",
    "antiguedad": "Fecha de alta del cliente.",
    "provincia": "Provincia de los clientes.",
    "num_lineas": "Numero de lineas moviles contratadas.",
    "num_lineas_impago": "Numero de lineas en impago.",
    "incidencia": " SI = el cliente ha tenido alguna incidencia o reclamacion.",
    "conexion": "Tipo de conexion de internet del cliente.",
    "vel_conexion": "Velocidad de conexion de internet.",
    "TV": "Tipo de paquete de tv contratado por el cliente.",
    "num_llamad_ent": "Numero de llamadas entrantes de todas sus lineas.",
    "num_llamad_sal": "Numero de llamadas salientes de todas sus lineas.",
    "mb_datos": "Mb de los datos consumidos en todas sus lineas.",
    "seg_llamad_ent": "Segundos consumidos en llamadas entrantes.",
    "seg_llamad_sal": "Segundos consumidos en llamadas salientes.",
    "financiacion": "SI = el cliente tiene financiado algun terminal.",
    "imp_financ": "El dinero mensual que paga por los terminales financiados.",
    "descuentos": "SI = el cliente tiene activado algun descuento."
  }

# infer dtypes
infer_dtypes: true

# Show the description at each variable (in addition to the overview tab)
show_variable_description: true

# Number of workers (0=multiprocessing.cpu_count())
pool_size: 0

# Show the progress bar
progress_bar: true

# Per variable type description settings
vars:
    num:
        quantiles:
              - 0.05
              - 0.25
              - 0.5
              - 0.75
              - 0.95
        skewness_threshold: 20
        low_categorical_threshold: 5
        # Set to zero to disable
        chi_squared_threshold: 0.999
    cat:
        length: true
        characters: true
        words: true
        cardinality_threshold: 50
        n_obs: 5
        # Set to zero to disable
        chi_squared_threshold: 0.999
        coerce_str_to_date: false
        redact: false
        histogram_largest: 50
    bool:
        n_obs: 3
        # string to boolean mapping dict
        mappings:
            t: true
            f: false
            yes: true
            no: false
            y: true
            n: false
            true: true
            false: false
    file:
        active: false
    image:
        active: false
        exif: true
        hash: true
    path:
        active: false
    url:
        active: false

# Sort the variables. Possible values: "ascending", "descending" or null (leaves original sorting)
sort: null

# which diagrams to show
missing_diagrams:
    bar: true
    matrix: true
    heatmap: true
    dendrogram: true

correlations:
    pearson:
      calculate: true
      warn_high_correlations: true
      threshold: 0.9
    spearman:
      calculate: true
      warn_high_correlations: false
      threshold: 0.9
    kendall:
      calculate: true
      warn_high_correlations: false
      threshold: 0.9
    phi_k:
      calculate: true
      warn_high_correlations: false
      threshold: 0.9
    cramers:
      calculate: true
      warn_high_correlations: true
      threshold: 0.9


# Bivariate / Pairwise relations
interactions:
  targets: []
  continuous: true

# For categorical
categorical_maximum_correlation_distinct: 100

report:
  precision: 10

# Plot-specific settings
plot:
    # Image format (svg or png)
    image_format: "svg"
    dpi: 800

    scatter_threshold: 1000

    correlation:
        cmap: 'RdBu'
        bad: '#000000'

    missing:
        cmap: 'RdBu'
        # Force labels when there are > 50 variables
        # https://github.com/ResidentMario/missingno/issues/93#issuecomment-513322615
        force_labels: true

    pie:
        # display a pie chart if the number of distinct values is smaller or equal (set to 0 to disable)
        max_unique: 10

    histogram:
        x_axis_labels: true
        y_axis_labels: true

        # Number of bins (set to 0 to automatically detect the bin size)
        bins: 80

        # Maximum number of bins (when bins=0)
        max_bins: 250

# The number of observations to show
n_obs_unique: 5
n_extreme_obs: 5
n_freq_table_max: 10

# Use `deep` flag for memory_usage
memory_deep: false

# Configuration related to the duplicates
duplicates:
    head: 10
    key: "# duplicates"

# Configuration related to the samples area
samples:
    head: 10
    tail: 10
    random: 0

# Configuration related to the rejection of variables
reject_variables: true

# When in a Jupyter notebook
notebook:
    iframe:
        height: '800px'
        width: '100%'
        # or 'src'
        attribute: 'srcdoc'

html:
    # Minify the html
    minify_html: true

    # Offline support
    use_local_assets: true

    # If true, single file, else directory with assets
    inline: true

    # Show navbar
    navbar_show: true

    # Assets prefix if inline = true
    assets_prefix: null

    # Styling options for the HTML report
    style:
      theme: 'flatly'
      logo: " data:image/png;base64,"
      primary_color: "#5cc4a0"

    full_width: true